import React from 'react';
import ParticlesBg from 'particles-bg';
import Roll from 'react-reveal';



class HomePage extends React.Component {
    render() {
        return (
            <header id='home'>
                <ParticlesBg num={200} type="lines" bg={true} />

                <div className='row banner'>
                    <div className='banner-text'>
                        <Roll top>
                            <h1 className="responsive-headline">Andrey Sek</h1>
                        </Roll>
                        <Roll top duration={1000}>
                            <h3>All is do is REACT & NODE with components to bring out the best feel of web development!</h3>
                        </Roll>
                        <Roll bottom duration={2000}>

                        </Roll>
                    </div>
                </div>
            </header>

        );

    }

}


export default HomePage
